import React from "react";

import HeaderImage1 from "../../../../../assets/images/headermain1";
import HeaderImage2 from "../../../../../assets/images/headermain2";
import ContainedButtons from "../../ui/ContainedButttons";

const headerimages = (props) => (
  <div
    style={{
      position: "relative",
      display: "inline-block",
      height: "800px",
      width: "800px",
    }}
  >
    <img src={HeaderImage1} alt="HeaderImage1" />

    <div style={{ position: "absolute", right: "0", zIndex: "5" }}>
      <ContainedButtons></ContainedButtons>
    </div>

    <div>
      <img src={HeaderImage2} alt="HeaderImage2" />
    </div>
  </div>
);

export default headerimages;
